function setup() {
  createCanvas(400, 400);

  randomSeed(738798)
  pixelDensity(30);
}

function draw() {
  background(255);
  strokeWeight(50);

  for(var i = 0; i < 100; i++) {
    draw_line();
  }
  noLoop();
}

function draw_line() {
  x = random(400);
  y = random(400);
  l = random(30,80);

  stroke(rc());
  line(x,y,x,y+l);
}

function rc() {
  return color(random(255),random(255),random(255),random(255));
}
